import React from 'react';
import './css/Services.css';

const Services = () => {
  return (
    <section id="services" className="services-section">
      <div className="container">
        <h2>Our Services</h2>
        <ul className="service-list">
          <li>Fever, Cold, Flu, Infection Treatment</li>
          <li>Diabetes, BP, Thyroid, and Cardiac Care</li>
          <li>Skin, Allergy & Hair Treatment</li>
          <li>Stomach, Acidity, Gastric Treatment</li>
          <li>Kidney, Liver, and Urine Disorders</li>
          <li>Minor Surgery & Wound Dressing</li>
          <li>IV Fluid, Nebulization, Emergency Care</li>
          <li>ECG & Diagnostic Services Available</li>
        </ul>
      </div>
    </section>
  );
};

export default Services;
